script: |
  super -f text -I q950.sql | sort > q950.out

inputs:
  - name: q950.sql
    data: |
      SELECT DISTINCT col1 * ( + col1 ) + - + ( - ( + col0 ) ) AS col1, + CAST ( NULL AS INTEGER ) FROM tab1 AS cor0;
  - name: tab1

outputs:
  - name: q950.out
    data: |
      110	-
      2300	-
      247	-
